//SPDX-License-Identifier: BUSL-1.1
pragma solidity ^0.8.0;

import "../interfaces/IVaultFactP.sol";

// Change factories in 1 step and events update also 1 step

contract DeployRCU_P {

    address public VaultFact;
    address public RiskProtocol;
    mapping (address => bool) public VaultFactList;
    mapping (address => bool) public SegaFactList;
    address[] public VaultList;


    event AdminChanged(address RP);
    event VFChanged(address vf);
    event SFListUpdated(address _sf, bool onOff);

    modifier isRP() {
        _isRP();
        _;
    }

    function _isRP() internal view {
        require (msg.sender == RiskProtocol,
        "Caller not RP");
    }

    constructor(address _vf, address _sf) {
        RiskProtocol = msg.sender;
        VaultFact = _vf;
        VaultFactList[VaultFact] = true;
        SegaFactList[_sf] = true;
    }

    function changeAdmin (address _rP) public isRP {
        RiskProtocol = _rP;
        emit AdminChanged(_rP);
    }

    function changeVaultFactory (address _vf) public isRP {
        VaultFact = _vf;
        VaultFactList[VaultFact] = true;
        emit VFChanged(_vf);
    }

    function launchVault() public returns (address){
        address vault = IVaultFactP(VaultFact).createVault(msg.sender);
        VaultList.push(vault);
        return vault;
    }

    function updateSegaFactList (address _sf, bool onOff) public isRP {
        SegaFactList[_sf] = onOff;
        emit SFListUpdated(_sf, onOff);
    }

    function verifySF (address _sf) public view returns (bool) {
        return SegaFactList[_sf];
    }

    function getVaultList() public view returns (address[] memory) {
        return VaultList;
    }
}
